Приложение для пациентов Системы клиник МЕДИ.
С помощью приложения Вы можете:
– записаться на приём в клиники МЕДИ, в том числе в режиме быстрой записи к Вашим лечащим врачам;
– получить дистанционную видеоконсультацию Вашего лечащего врача отделения семейной медицины;
– получить информацию о ближайших записях в клиники МЕДИ;
– увидеть приглашения на приём к врачам клиник МЕДИ; 
– получить полную историю записей в клиники МЕДИ за последние пять лет;
– увидеть памятки перед исследованиями и рекомендации врачей после приёмов;
– задать вопросы по услугам и об организации приёма в клиниках операторам-консультантам МЕДИ;
– оценить визит к врачу, оставить отзыв;
– получить доступ к личному кабинету МЕДИ вашего ребенка;
– получить другую полезную информацию.

